import React from 'react';
import "./Nav.css";

function Nav() {
    use
    return (
        <div className="nav">
        <img
        className="nav__logo"
        src="https://commons.wikimedia.org/wiki/Category:Netflix_logos#/media/File:Logonfx.png"
        alt="Netflix Logo"
        />
        </div>
    );
}

export default Nav;
